script: |
  super -f text -I q7894.spq | sort > q7894.out

inputs:
  - name: q7894.spq
    data: |
      SELECT - col2 * + ( + - 92 ) + - + 69 AS col1, - col1 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT col2 BETWEEN NULL AND + - CAST ( NULL AS INTEGER ) * - + col0 + - 51 - - col2;
  - name: tab2

outputs:
  - name: q7894.out
    data: |
